const InputWithLabel = ({ label, placeholder, onChange, value }) => {
  return (
    <div>
      <label>{label}</label>
      <input
        type="text"
        placeholder={placeholder}
        onChange={onChange}
        value={value}
      ></input>
    </div>
  );
};

export default InputWithLabel;
